#include <iostream>

#include <vector>

class Solution {
    public:
        bool canJump(std::vector<int>& nums) {

            if (nums.size() == 1) {return true;}
            
            std::vector<bool> jumpable(nums.size(), false);

            jumpable[0] = true;

            for(int i = 0; i < nums.size(); i++) {
                if (jumpable[i]) {

                    if (nums[i] >= nums.size() - i) {
                        return true;
                    }

                    for (int j = i+1; j < nums.size() && j < i + nums[i] + 1; j++) {
                        jumpable[j] = true;
                    }
                }
            }

            bool can = jumpable[nums.size() - 1];

            return can;
        }
};

